import 'package:weatherdemo/feature/home_weather/framaework/data/config/weather_temp.dart';import 'Feels_like.dart';import 'Temp.dart';class Daily {  int? dt;  int? sunrise;  int? sunset;  int? moonrise;  int? moonset;  double? moonPhase;  Temp? temp;  FeelsLike? feelsLike;  int? pressure;  int? humidity;  double? dewPoint;  double? windSpeed;  int? windDeg;  double? windGust;  List<WeatherTemp>? weatherTemp;  int? clouds;  int? pop;  double? uvi;  Daily(      this.dt,       this.sunrise,       this.sunset,       this.moonrise,       this.moonset,       this.moonPhase,       this.temp,       this.feelsLike,       this.pressure,       this.humidity,       this.dewPoint,       this.windSpeed,       this.windDeg,       this.windGust,       this.weatherTemp,      this.clouds,       this.pop,       this.uvi);  Daily.fromJson(dynamic json) {    dt = json['dt'];    sunrise = json['sunrise'];    sunset = json['sunset'];    moonrise = json['moonrise'];    moonset = json['moonset'];    moonPhase = json['moon_phase'];    temp = json['temp'] != null ? Temp.fromJson(json['temp']) : null;    feelsLike = json['feels_like'] != null ? FeelsLike.fromJson(json['feels_like']) : null;    pressure = json['pressure'];    humidity = json['humidity'];    dewPoint = json['dew_point'];    windSpeed = json['wind_speed'];    windDeg = json['wind_deg'];    windGust = json['wind_gust'];    if (json['weather'] != null) {      weatherTemp = [];      json['weather'].forEach((v) {        weatherTemp?.add(WeatherTemp.fromJson(v));      });    }    clouds = json['clouds'];    pop = json['pop'];    uvi = json['uvi'];  }}